import React from 'react'

import { useState } from "react";
function MemberView(){
    let [formData,setFormData]=useState({
        Echs :'',
        Official_name:'',
        address:'',
        email:'',
        phone:'',
    });
    let handleChange=(e)=>{
        let name=e.target.name;
        let value=e.target.value;
        console.log(name);
        setFormData({
            ...formData,
            [name]: value,

        })
    }
    return (
        <>
        
        <div class="card-body">
            <div class="class-header">
                <h1>Registration</h1>
            </div>
    <form>
        <div class="card-body">
            <label>Full Name</label>
            <input onChange={handleChange}type="text" class="form-control" name="full_name"/>
            </div>
            <div class="form-group">
                <label> Address </label>
                <textarea onChange={handleChange}type="text" class="form-control" name="Address" />
                </div>
           < div class="form-group">
                <label>phone</label>
                <textarea onChange={handleChange}type="number" class="form-control" name="phone" />
                </div>
             <div class="form-group">
                <label>Email</label>
                <textarea onChange={handleChange}type="text" class="form-control" name="email" />
                
                </div>
             <div class="form-group pt-2">
                <input type="submit" class="btn btn-primary" value="Register Now" />
                </div>
                </form>
                </div>
                
    </>
        
    )
}
export default MemberView;
